      SELECT DISTINCT + col0 * + col2 FROM tab0 (FORMAT parquet) WHERE NOT - 16 * + col1 BETWEEN - 95 + - col2 AND ( col1 + col1 );
  - name: tab0

outputs:
  - name: q4065.out
    data: |
      705
      870
